// import logo from './logo.svg';
import './App.css';
import Auth from './components/Auth/Auth';
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/global.css';
import { Route } from 'react-router';

function App() {
  return (

    <>
    <BrowserRouter>
    <Switch>
    <Route exact path="/" component={Auth}/>
    </Switch>
    </BrowserRouter>
    </>

  );
}

export default App;
